  return (
    <div>
      <div className="main-panel">
        <div className="content">
          <div className="row equal">
            <div className="col-lg-12 col-md-12"><ListImages /></div>
          </div>
          <div className="row">
            <div className="col-12"><Graph /></div>
          </div>

        </div>
      </div >
    </div>
  );

}
